(4752, '2023-06-06 17:00:00', 'indonesia resmi didapuk oleh AFC menjadi salah satu dari 11 negara tuan rumah babak kualifikasi Piala Asia U-23 2024. Hal ini tidak lepas dari peran Ketum PSSI Erick Thohir yang mempunyai relasi internasionalnya', 'indonesia resmi didapuk oleh afc menjadi salah satu dari 11 negara tuan rumah babak kualifikasi piala asia u-23 2024. hal ini tidak lepas dari peran ketum pssi erick thohir yang mempunyai relasi internasionalnya', 'indonesia resmi didapuk oleh afc menjadi salah satu dari negara tuan rumah babak kualifikasi piala asia hal ini tidak lepas dari peran ketum pssi erick thohir yang mempunyai relasi internasionalnya ', 'indonesia resmi dipilih oleh afc menjadi salah satu dari negara tuan rumah babak kualifikasi piala asia hal ini tidak lepas dari peran ketua umum pssi erick thohir yang mempunyai relasi internasionalnya', 'indonesia resmi pilih oleh afc menjadi salah satu dari negara tuan rumah babak kualifikasi piala asia hal ini tidak lepas dari peran ketua umum pssi erick thohir yang mempunyai relasi international', 'indonesia resmi pilih afc salah negara tuan rumah babak kualifikasi piala asia tidak lepas peran ketua pssi erick thohir relasi international', 'non hs', '2023-06-07 16:18:48', '2023-06-07 16:18:48'),
(4753, '2023-06-06 17:00:00', '@PSSI belajar dulu tentang kemanusiaan, punya rasa empati dan solidaritas, baru kelak kalian akan jadi pemain hebat, menjadi pesepakbola hebat tdk dgn cara instan, tingkatkan prestasi dr kemampuan skill bukan hasil pemberian yakinlah kelak kalian akan jd pemain yg disegani dunia', '@pssi belajar dulu tentang kemanusiaan, punya rasa empati dan solidaritas, baru kelak kalian akan jadi pemain hebat, menjadi pesepakbola hebat tdk dgn cara instan, tingkatkan prestasi dr kemampuan skill bukan hasil pemberian yakinlah kelak kalian akan jd pemain yg disegani dunia', 'belajar dulu tentang kemanusiaan punya rasa empati dan solidaritas baru kelak kalian akan jadi pemain hebat menjadi pesepakbola hebat tdk dgn cara instan tingkatkan prestasi dr kemampuan skill bukan hasil pemberian yakinlah kelak kalian akan jd pemain yg disegani dunia ', 'belajar dahulu tentang kemanusiaan punya rasa empati dan solidaritas baru kelak kalian akan jadi pemain hebat menjadi pesepakbola hebat tidak dengan cara instan tingkatkan prestasi dari kemampuan kemampuan bukan hasil pemberian yakinlah kelak kalian akan ', 'belajar dahulu tentang manusia punya rasa empati dan solidaritas baru kelak kalian akan jadi pemain hebat menjadi sepakbola hebat tidak dengan cara instan tingkat prestasi dari mampu mampu bukan hasil pemberian yakin kelak kalian akan jadi pemain yang seg', 'belajar manusia empati solidaritas kelak main hebat sepak bola hebat tidak instan tingkat prestasi hasil pemberian kelak main segan dunia', 'non hs', '2023-06-07 16:19:12', '2023-06-07 16:19:12'),
(4754, '2023-06-06 17:00:00', 'Asal omong saja lu bilang sepakbola Indonesia gak ada prestasi.. Kl gitu samain saja prestasi timnas PSSI dengan PKS ,tdk ada prestasi yg bisa dibanggakan...cuma banyak omong', 'asal omong saja lu bilang sepakbola indonesia gak ada prestasi.. kl gitu samain saja prestasi timnas pssi dengan pks ,tdk ada prestasi yg bisa dibanggakan...cuma banyak omong', 'asal omong saja lu bilang sepakbola indonesia gak ada prestasi kl gitu samain saja prestasi timnas pssi dengan pks tdk ada prestasi yg bisa dibanggakan cuma banyak omong ', 'asal omong saja kamu katakan sepakbola indonesia tidak ada prestasi kalau begitu samakan saja prestasi tim nasional pssi dengan pks tidak ada prestasi yang bisa dibanggakan hanya banyak omong', 'asal omong saja kamu katakan sepakbola indonesia tidak ada prestasi kalau begitu samakan saja prestasi tim nasional pssi dengan pks tidak ada prestasi yang bisa bangga hanya banyak omong', 'omong sepak bola indonesia tidak prestasi samakan prestasi tim nasional pssi pks tidak prestasi bangga omong', 'penghinaan', '2023-06-07 16:20:10', '2023-06-07 16:20:10'),
