(4756, '2023-06-06 17:00:00', 'Semenjak BUMN dipegang @erickthohir KEUNTUNGAN dn KERUGIAN BUMN tergantung situasi POLITIK...BUMN akan tiba2 UNTUNG dikala mendekati TAHUN POLITIK...krn keUNTUNGAN BUMN bs menjadi modal PENCITRAAN utk KONTESTASI PILPRes 2024', 'semenjak bumn dipegang @erickthohir keuntungan dn kerugian bumn tergantung situasi politik...bumn akan tiba2 untung dikala mendekati tahun politik...krn keuntungan bumn bs menjadi modal pencitraan utk kontestasi pilpre 2024', 'semenjak bumn dipegang keuntungan dn kerugian bumn tergantung situasi politik bumn akan tiba untung dikala mendekati tahun politik krn keuntungan bumn bs menjadi modal pencitraan utk kontestasi pilpre ', 'semenjak bumn dipegang keuntungan dan kerugian bumn tergantung situasi politik bumn akan tiba untung dikala mendekati tahun politik karena keuntungan bumn bisa menjadi modal pencitraan untuk kontestasi pilpre', 'sejak bumn pegang untung dan rugi bumn gantung situasi politik bumn akan tiba untung dikala dekat tahun politik karena untung bumn bisa menjadi modal citra untuk kontes pilpre', 'bumn pegang untung rugi bumn tergantung situasi politik bumn untung dikala politik untung bumn modal citra kontes pilih presiden', 'provokasi', '2023-06-07 16:21:04', '2023-06-07 16:21:04'),
