(18363, '2023-07-01 17:00:00', 'Sebenarnya kita bukan bela Israel. Cuman karena udah jadi tuan rumah, kalau kita cancel hanya karena nolak israel, terus PSSI di banned kasian yang hidup dari sepak bola, nanti gak bisa ber kompetisi resmi dari fifa, gak ada pemasukan.   Otaknya kadang di pantat orang kek gini', 'sebenarnya kita bukan bela israel. cuman karena udah jadi tuan rumah, kalau kita cancel hanya karena nolak israel, terus pssi di banned kasian yang hidup dari sepak bola, nanti gak bisa ber kompetisi resmi dari fifa, gak ada pemasukan.   otaknya kadang di pantat orang kek gini', ' sebenarnya kita bukan bela israel cuman karena udah jadi tuan rumah kalau kita cancel hanya karena nolak israel terus pssi di banned kasian yang hidup dari sepak bola nanti gak bisa ber kompetisi resmi dari fifa gak ada pemasukan otaknya kadang di pantat orang kek gini ', 'sebenarnya kita bukan bela israel hanya karena sudah jadi tuan rumah kalau kita tolak hanya karena tolak israel terus pssi di di larang kasihan yang hidup dari sepak bola nanti tidak bisa ber kompetisi resmi dari fifa tidak ada pemasukan otaknya kadang di', 'sebenarnya kita bukan bela israel hanya karena sudah jadi tuan rumah kalau kita tolak hanya karena tolak israel terus pssi di di larang kasihan yang hidup dari sepak bola nanti tidak bisa ber kompetisi resmi dari fifa tidak ada masuk otak kadang di pantat', 'bela israel tuan rumah tolak tolak israel pssi larang kasihan hidup sepak bola tidak kompetisi resmi fifa tidak masuk otak pantat', 'penghinaan', '2023-07-02 16:26:02', '2023-07-02 16:26:02'),
