(18365, '2023-07-02 17:00:00', 'Taik.  Ratusan Orang Di Bantai Polisi Di Stadion Kanjuruhan Kok Ga Pakai Pita Hitam Kalian Dalam Setiap Pertandingan ?  Minim Prestasi dan Rangking FIFA Anjlok Aja, Mau Gaya Main di  Pildun Lewat Jalur Ngemis Jadi Tuan Rumah bukan Karena Prestasi Aja Belagu Lu.', 'taik.  ratusan orang di bantai polisi di stadion kanjuruhan kok ga pakai pita hitam kalian dalam setiap pertandingan ?  minim prestasi dan rangking fifa anjlok aja, mau gaya main di  pildun lewat jalur ngemis jadi tuan rumah bukan karena prestasi aja belagu lu.', ' taik ratusan orang di bantai polisi di stadion kanjuruhan kok ga pakai pita hitam kalian dalam setiap pertandingan minim prestasi dan rangking fifa anjlok aja mau gaya main di pildun lewat jalur ngemis jadi tuan rumah bukan karena prestasi aja belagu lu ', 'taik ratusan orang di bantai polisi di stadion kanjuruhan kok tidak pakai pita hitam kalian dalam setiap pertandingan minim prestasi dan peringkat fifa turun saja mau gaya main di piala dunia lewat jalur ngemis jadi tuan rumah bukan karena prestasi saja s', 'taik ratusan orang di bantai polisi di stadion kanjuruhan kok tidak pakai pita hitam kalian dalam setiap tanding minim prestasi dan peringkat fifa turun saja mau gaya main di piala dunia lewat jalur ngemis jadi tuan rumah bukan karena prestasi saja sombon', 'taik ratusan bantai polisi stadion kanjuruhan tidak pakai pita hitam tanding minim prestasi peringkat fifa turun gaya main piala dunia jalur ngemis tuan rumah prestasi sombong', 'penghinaan', '2023-07-02 17:07:11', '2023-07-02 17:07:11'),
