(18467, '2023-07-05 17:00:00', 'Anies waktu pilkada bisa menang membodohi warga Jakarta jualan dan nakut nakutin pakai ayat dan mayat Dia berhasil dulu, tapi itu juga momen kekalahan dia .. karena Indonesia melihat bahwa Anies demi Ambisi Politik kekuasaan dia Bisa sekeji itu MEMPERMAINKAN AGAMA', 'anies waktu pilkada bisa menang membodohi warga jakarta jualan dan nakut nakutin pakai ayat dan mayat dia berhasil dulu, tapi itu juga momen kekalahan dia .. karena indonesia melihat bahwa anies demi ambisi politik kekuasaan dia bisa sekeji itu mempermainkan agama', ' anies waktu pilkada bisa menang membodohi warga jakarta jualan dan nakut nakutin pakai ayat dan mayat dia berhasil dulu tapi itu juga momen kekalahan dia karena indonesia melihat bahwa anies demi ambisi politik kekuasaan dia bisa sekeji itu mempermainkan agama ', 'anies waktu pemilihan kepala daerah bisa menang membodohi masyarakat jakarta jualan dan nakut nakutin pakai ayat dan mayat dia berhasil dahulu tapi itu juga momen kekalahan dia karena indonesia melihat bahwa anies demi ambisi politik kekuasaan dia bisa se', 'anies waktu pilih kepala daerah bisa menang bodoh masyarakat jakarta jual dan takut takut pakai ayat dan mayat dia hasil dahulu tapi itu juga momen kalah dia karena indonesia melihat bahwa anies demi ambisi politik kuasa dia bisa keji itu main agama', 'anies pilih kepala daerah menang bodoh masyarakat jakarta jual takut takut pakai ayat mayat hasil momen kalah indonesia anies ambisi politik kuasa keji main agama', 'penghinaan', '2023-07-06 04:12:09', '2023-07-06 04:12:09'),
