(18469, '2023-07-05 17:00:00', 'Aroma politiknya besar sekali. Pernyataan tidak cerdas dan tak mendasar dari seorang ketua PSSI sekaligus menteri. Stadion  ini, dengan kapasitas 20.310 tempat duduk aja bisa jadi tempat final Wolrd Cup U-17 tahun 2019, masa JIS langsung dicoret? https://t.co/fI8wT2uE5x https://t.co/NdmIsvRXSs', 'aroma politiknya besar sekali. pernyataan tidak cerdas dan tak mendasar dari seorang ketua pssi sekaligus menteri. stadion  ini, dengan kapasitas 20.310 tempat duduk aja bisa jadi tempat final wolrd cup u-17 tahun 2019, masa jis langsung dicoret? https://t.co/fi8wt2ue5x https://t.co/ndmisvrxss', ' aroma politiknya besar sekali pernyataan tidak cerdas dan tak mendasar dari seorang ketua pssi sekaligus menteri stadion ini dengan kapasitas tempat duduk aja bisa jadi tempat final wolrd cup u tahun masa jis langsung dicoret ', 'aroma politiknya besar sekali pernyataan tidak cerdas dan tak mendasar dari seorang ketua pssi sekaligus menteri stadion ini dengan kapasitas tempat duduk saja bisa jadi tempat final wolrd cup kamu tahun masa jis langsung dicoret', 'aroma politik besar sekali pernyataan tidak cerdas dan tak mendasar dari seorang ketua pssi sekaligus menteri stadion ini dengan kapasitas tempat duduk saja bisa jadi tempat final wolrd cup kamu tahun masa jis langsung coret', 'aroma politik pernyataan tidak cerdas mendasar ketua pssi menteri stadion kapasitas duduk final wolrd langsung coret', 'provokasi', '2023-07-06 04:22:03', '2023-07-06 04:22:03');
