(18470, '2023-07-05 17:00:00', 'Warga JAWA TENGAH Sibuk Mencari cara Bertahan Hidup dari KEMISKINAN  Eh GUBERNUR AKTIF JAWA TENGAH Malah sibuk Safari Politik Keluar Daerah  Bisa Gak sih JAWA TENGAH Dikasih PLT GUBERNUR Aja ??  Ada dan tidak ada GANJAR keadaan nya pun sama saja sama sama BERANTAKAN JAWA TENGAH', 'warga jawa tengah sibuk mencari cara bertahan hidup dari kemiskinan  eh gubernur aktif jawa tengah malah sibuk safari politik keluar daerah  bisa gak sih jawa tengah dikasih plt gubernur aja ??  ada dan tidak ada ganjar keadaan nya pun sama saja sama sama berantakan jawa tengah', ' warga jawa tengah sibuk mencari cara bertahan hidup dari kemiskinan eh gubernur aktif jawa tengah malah sibuk safari politik keluar daerah bisa gak sih jawa tengah dikasih plt gubernur aja ada dan tidak ada ganjar keadaan nya pun sama saja sama sama berantakan jawa tengah ', 'masyarakat jawa tengah sibuk mencari cara bertahan hidup dari kemiskinan eh gubernur aktif jawa tengah bahkan sibuk safari politik keluar daerah bisa tidak sih jawa tengah dikasih plt gubernur saja ada dan tidak ada ganjar keadaan nya pun sama saja sama s', 'masyarakat jawa tengah sibuk cari cara tahan hidup dari miskin eh gubernur aktif jawa tengah bahkan sibuk safari politik keluar daerah bisa tidak sih jawa tengah beri plt gubernur saja ada dan tidak ada ganjar keadaan nya pun sama saja sama sama berantaka', 'masyarakat jawa sibuk cari tahan hidup miskin gubernur aktif jawa sibuk safari politik daerah tidak jawa gubernur tidak ganjar berantakan jawa', 'provokasi', '2023-07-06 04:32:41', '2023-07-06 04:32:41'),
