(18480, '2023-07-08 17:00:00', 'Mereka ingin mendapatkan panggung di JIS dan ingin menghapus jejak Anies...mereka ingin mendapatkan citra bahwa mereka yang paling benar dan paling bisa kerja dan paling ga punya salah. Salahnya akan di bebankan ke Anies.. cara politik yg licik.', 'mereka ingin mendapatkan panggung di jis dan ingin menghapus jejak anies...mereka ingin mendapatkan citra bahwa mereka yang paling benar dan paling bisa kerja dan paling ga punya salah. salahnya akan di bebankan ke anies.. cara politik yg licik.', ' mereka ingin mendapatkan panggung di jis dan ingin menghapus jejak anies mereka ingin mendapatkan citra bahwa mereka yang paling benar dan paling bisa kerja dan paling ga punya salah salahnya akan di bebankan ke anies cara politik yg licik ', 'mereka ingin mendapatkan panggung di jis dan ingin menghapus jejak anies mereka ingin mendapatkan citra bahwa mereka yang paling benar dan paling bisa kerja dan paling tidak punya salah salahnya akan di bebankan ke anies cara politik yang licik', 'mereka ingin mendapatkan panggung di jis dan ingin hapus jejak anies mereka ingin mendapatkan citra bahwa mereka yang paling benar dan paling bisa kerja dan paling tidak punya salah salah akan di beban ke anies cara politik yang licik', 'panggung hapus jejak anies citra kerja tidak salah salah beban anies politik licik', 'provokasi', '2023-07-09 15:17:04', '2023-07-09 15:17:04'),
