(18488, '2023-07-10 17:00:00', 'Ketua Umum PSSI, Erick Thohir, bakal turun tangan mengurusi dunia perwasitan di sepak bola Indonesia. Erick Thohir mengaku akan menjadi Ketua Komite Wasit. @erickthohir #GueBarengErickThohir https://t.co/wRkpeI97KZ	', 'ketua umum pssi, erick thohir, bakal turun tangan mengurusi dunia perwasitan di sepak bola indonesia. erick thohir mengaku akan menjadi ketua komite wasit. @erickthohir #guebarengerickthohir https://t.co/wrkpei97kz	', ' ketua umum pssi erick thohir bakal turun tangan mengurusi dunia perwasitan di sepak bola indonesia erick thohir mengaku akan menjadi ketua komite wasit ', 'ketua umum pssi erick thohir akan turun tangan mengurusi dunia perwasitan di sepak bola indonesia erick thohir mengaku akan menjadi ketua komite wasit', 'ketua umum pssi erick thohir akan turun tangan urus dunia wasit di sepak bola indonesia erick thohir aku akan menjadi ketua komite wasit', 'ketua pssi erick thohir turun tangan urus dunia wasit sepak bola indonesia erick thohir ketua komite wasit', 'non hs', '2023-07-11 09:55:28', '2023-07-11 09:55:28'),
(18490, '2023-07-11 17:00:00', 'Ternyata menunggangi agama itu emang strategi Prabowo di 2019, meniru sukses strategi Anus di Pilgub 2017. Skrg bagi kerja. Agama dimainkan via Anus, Prabowo bagian membelah pendukung Jokowi dgn cara nempel kayak perangko ke Jokowi. Banyak yg belum sadar bhw Prabowo = Anus.', 'ternyata menunggangi agama itu emang strategi prabowo di 2019, meniru sukses strategi anus di pilgub 2017. skrg bagi kerja. agama dimainkan via anus, prabowo bagian membelah pendukung jokowi dgn cara nempel kayak perangko ke jokowi. banyak yg belum sadar bhw prabowo = anus.', ' ternyata menunggangi agama itu emang strategi prabowo di meniru sukses strategi anus di pilgub skrg bagi kerja agama dimainkan via anus prabowo bagian membelah pendukung jokowi dgn cara nempel kayak perangko ke jokowi banyak yg belum sadar bhw prabowo anus ', 'ternyata menunggangi agama itu memang strategi prabowo di meniru sukses strategi anus di pemilihan gubernur sekarang bagi kerja agama dimainkan via anus prabowo bagian membelah pendukung jokowi dengan cara tempel seperti perangko ke jokowi banyak yang belum sadar bhw prabowo anus', 'ternyata tunggang agama itu memang strategi prabowo di tiru sukses strategi anus di pilih gubernur sekarang bagi kerja agama main via anus prabowo bagian belah pendukung jokowi dengan cara tempel seperti perangko ke jokowi banyak yang belum sadar bhw prabowo anus', 'tunggang agama strategi prabowo tiru sukses strategi anus pilih gubernur kerja agama main anus prabowo belah dukung jokowi tempel perangko jokowi sadar prabowo anus', 'provokasi', '2023-07-12 13:15:14', '2023-07-12 13:15:14'),
(18491, '2023-07-11 17:00:00', 'Kata anies, \"Mayoritas duit dari Nasdem, lebihnya dari relawan,\" terang dia bocorkan isi dapur koalisi perubahan.  Bisa jd relawannya dari Nasdem. Nasdem nya dari BTS, ya gak seh.? ğŸ™ˆ Bahkan katanya akan diselidiki apakah ada aliran dana korupsi ke partai politik. Ini yang bikin ngeri-ngeri sedap lhoâ€¦', 'kata anies, \"mayoritas duit dari nasdem, lebihnya dari relawan,\" terang dia bocorkan isi dapur koalisi perubahan.  bisa jd relawannya dari nasdem. nasdem nya dari bts, ya gak seh.? ğŸ™ˆ bahkan katanya akan diselidiki apakah ada aliran dana korupsi ke partai politik. ini yang bikin ngeri-ngeri sedap lhoâ€¦', ' kata anies mayoritas duit dari nasdem lebihnya dari relawan terang dia bocorkan isi dapur koalisi perubahan bisa jd relawannya dari nasdem nasdem nya dari bts ya gak seh bahkan katanya akan diselidiki apakah ada aliran dana korupsi ke partai politik ini yang bikin ngeri ngeri sedap lho ', 'kata anies mayoritas uang dari nasdem lebihnya dari relawan terang dia bocorkan isi dapur koalisi perubahan bisa jadi relawannya dari nasdem nasdem nya dari bts iya tidak seh bahkan katanya akan diselidiki apakah ada aliran dana korupsi ke partai politik ini yang buat ngeri ngeri sedap lho', 'kata anies mayoritas uang dari nasdem lebih dari relawan terang dia bocor isi dapur koalisi perubahan bisa jadi relawan dari nasdem nasdem nya dari bts iya tidak seh bahkan katanya akan selidik apakah ada aliran dana korupsi ke partai politik ini yang buat ngeri ngeri sedap lho', 'anies mayoritas uang nasdem relawan terang bocor dapur koalisi perubahan relawan nasdem nasdem tidak selidik aliran dana korupsi partai politik ngeri ngeri sedap', 'provokasi', '2023-07-12 13:26:30', '2023-07-12 13:26:30'),
(18492, '2023-07-12 17:00:00', 'Memang repot KLO capres tukang ngibul ujung ujung pendukungnya ngibul semua', 'memang repot klo capres tukang ngibul ujung ujung pendukungnya ngibul semua', ' memang repot klo capres tukang ngibul ujung ujung pendukungnya ngibul semua ', 'memang repot kalau calon presiden tukang berbohong ujung ujung pendukungnya berbohong semua', 'memang repot kalau calon presiden tukang bohong ujung ujung dukung bohong semua', 'repot calon presiden tukang bohong ujung ujung dukung bohong', 'penghinaan', '2023-07-13 12:31:31', '2023-07-13 12:31:31'),
(18493, '2023-07-12 17:00:00', 'â€œPantun Si Tukang Ngibulâ€   Makan Lauknya Sarden Teri Dimakan Dengan Nasi Ngebul Jangan Percaya Pada Anies Lagi Dia Dan Sohib Nya Tukang Ngibul', 'â€œpantun si tukang ngibulâ€   makan lauknya sarden teri dimakan dengan nasi ngebul jangan percaya pada anies lagi dia dan sohib nya tukang ngibul', ' pantun si tukang ngibul makan lauknya sarden teri dimakan dengan nasi ngebul jangan percaya pada anies lagi dia dan sohib nya tukang ngibul ', 'pantun si tukang berbohong makan lauknya sarden teri dimakan dengan nasi ngebul jangan percaya menjadi anies lagi dia dan sahabat nya tukang berbohong', 'pantun si tukang bohong makan lauk sarden teri makan dengan nasi ngebul jangan percaya menjadi anies lagi dia dan sahabat nya tukang bohong', 'pantun tukang bohong makan lauk sarden teri makan nasi ngebul percaya anies sahabat tukang bohong', 'provokasi', '2023-07-13 12:39:47', '2023-07-13 12:39:47'),
(18494, '2023-07-12 17:00:00', 'Mereka takut sama pak NOVEL bang.... ğŸ˜„ Karena saat pak ANIES ditakdirkan jadi Presiden. Bukan mustahil pak NOVEL yg akan jadi Pilot KPK. Dan akan banyak manusia2 yg korupsi saat ini menikmati  bobok di KANDANG MANUSIA.', 'mereka takut sama pak novel bang.... ğŸ˜„ karena saat pak anies ditakdirkan jadi presiden. bukan mustahil pak novel yg akan jadi pilot kpk. dan akan banyak manusia2 yg korupsi saat ini menikmati  bobok di kandang manusia.', ' mereka takut sama pak novel bang karena saat pak anies ditakdirkan jadi presiden bukan mustahil pak novel yg akan jadi pilot kpk dan akan banyak manusia yg korupsi saat ini menikmati bobok di kandang manusia ', 'mereka takut sama pak novel bang karena saat pak anies ditakdirkan jadi presiden bukan mustahil pak novel yang akan jadi pilot kpk dan akan banyak manusia yang korupsi saat ini menikmati tidur di kandang manusia', 'mereka takut sama pak novel bang karena saat pak anies takdir jadi presiden bukan mustahil pak novel yang akan jadi pilot kpk dan akan banyak manusia yang korupsi saat ini nikmat tidur di kandang manusia', 'takut novel bang anies takdir presiden mustahil novel pilot manusia korupsi nikmat tidur kandang manusia', 'provokasi', '2023-07-13 12:44:54', '2023-07-13 12:44:54'),
(18495, '2023-07-12 17:00:00', 'Heh buzzer taek â€¼ï¸ emx JIS punya si Anies njing  â€¼ï¸  Pembangunan JIS udah ada rencana dr gubernur dulu2 dan si Anies dapet ngutang duit triliunan dr pusat dan pke duit dana pemulihan ekonomi warga â€¼ï¸  Dah gtu ga bner lg bnyak yg ambruk dan musti di renovasi krn bnyak di korup', 'heh buzzer taek â€¼ï¸ emx jis punya si anies njing  â€¼ï¸  pembangunan jis udah ada rencana dr gubernur dulu2 dan si anies dapet ngutang duit triliunan dr pusat dan pke duit dana pemulihan ekonomi warga â€¼ï¸  dah gtu ga bner lg bnyak yg ambruk dan musti di renovasi krn bnyak di korup', ' heh buzzer taek emx jis punya si anies njing pembangunan jis udah ada rencana dr gubernur dulu dan si anies dapet ngutang duit triliunan dr pusat dan pke duit dana pemulihan ekonomi warga dah gtu ga bner lg bnyak yg ambruk dan musti di renovasi krn bnyak di korup ', 'heh buzzer taek emx jis punya si anies anjing pembangunan jis sudah ada rencana dari gubernur dahulu dan si anies dapat hutang uang triliunan dari pusat dan pakai uang dana pemulihan ekonomi masyarakat sudah gtu tidak benar lagi banyak yang jatuh dan mesti di renovasi karena banyak di korupsi', 'heh buzzer taek emx jis punya si anies anjing bangun jis sudah ada rencana dari gubernur dahulu dan si anies dapat hutang uang triliun dari pusat dan pakai uang dana pulih ekonomi masyarakat sudah gtu tidak benar lagi banyak yang jatuh dan mesti di renovasi karena banyak di korupsi', 'heh buzzer taek jis anies anjing bangun rencana gubernur anies hutang uang triliun pusat pakai uang dana pulih ekonomi masyarakat tidak jatuh mesti renovasi korupsi', 'penghinaan', '2023-07-13 12:52:53', '2023-07-13 12:52:53'),
(18496, '2023-07-12 17:00:00', 'WASPADA!!!!, PRESIDEN DJOKO WIDODO & BANK SUMSEL BABEL SUNGGUH SUKSES MEMBANGUN PELACUR- PELACUR CILIK WARIA SEBAGAI SUMBER DAYA PEMBANGUNAN REPUBLIK bobrok INDONESIA.', 'waspada!!!!, presiden djoko widodo & bank sumsel babel sungguh sukses membangun pelacur- pelacur cilik waria sebagai sumber daya pembangunan republik bobrok indonesia.', ' waspada presiden djoko widodo bank sumsel babel sungguh sukses membangun pelacur pelacur cilik waria sebagai sumber daya pembangunan republik bobrok indonesia ', 'waspada presiden djoko widodo bank sumsel babel sungguh sukses membangun pelacur pelacur kecil wanita pria sebagai sumber daya pembangunan republik bobrok indonesia', 'waspada presiden djoko widodo bank sumsel babel sungguh sukses bangun lacur lacur kecil wanita pria sebagai sumber daya bangun republik bobrok indonesia', 'waspada presiden djoko widodo bank sumsel babel sungguh sukses bangun lacur lacur wanita pria sumber daya bangun republik bobrok indonesia', 'provokasi', '2023-07-13 12:56:25', '2023-07-13 12:56:25'),
